values:
&nbsp;Paulo Coelho wrote in &quot;The Witch of Portabello&quot; that we learn when we teach something that we don't know. I found it to be true today. I was appointed as a Chair for the discussion group of people who are more mature and specialised than me, and who are also stronger natural leaders than I am. Every single one of the group participants was not only a leader, but also an extrovert, which made things harder, as extroverts tend to bark their ideas out loud and lack capacity of listening to others without interrupting, unlike introverts, who tend to speak in turn and to give feedback. These people that I am stuck with had communication problems before, which resulted in misunderstandings, unspoken conflicts and extremely low productivity. I found it hard, especially so as a couple of them did not expect ME to be chairing the meeting, and some took my ways of organising and running the meeting with certain agression, as well as others criticized my ideas on the project itself, but I am glad to report a really great progress in getting the planned work done, some progress on actually hearing each other and cooperating, bringing the conflict out in the open air (and thus eliminating it's silent burden, making it easier for everyone as everyone knows what is going on), and giving everyone's ideas the respect they deserve. Great stuff!&nbsp;

What I learned from this potentially psychologically threatening for me situation is that when things don't run smoothly in a group communication, everyone feels discomfort; however it is possible to reduce the level of that discomfort to a minimum, to equalize it, by concentrating on common grounds and positive encouragement and by stressing out an individual value of each participant, which then allows for a better productivity, providing the chair does not only play the role of a mediator that concentrates on psychological well-being of participants but also structures and then summarizes the discussion.&nbsp;

Pheeew.... another week and it'll be over. What an invaluable experience!
